import React from "react";
import {NavLink} from "react-router-dom"

const Navbar=()=>{
    return(
       <>
         <NavLink style={{color:"red"}} to="/"> About Us</NavLink>
         <NavLink to="/contact"> contact</NavLink><br/>
         <a href="/" >About us</a>
         <a href="/contact" >contact</a>
       </>
    )
}

export default Navbar
